import React from 'react';
import styles from "../styles/Navbar.module.css"
import {Link} from "react-router-dom"

const Navbar = () => {

    return(
        <header>
            <div className={styles.header_content}>
                <Link to='/'></Link>
            </div>
        </header>
    )
}

export default Navbar
